css:
@-moz-document domain("cymath.com") {
body {
    background-color: #242424;
}
div.content {
    background-color: #080808;
    color: #fff;
}
div.header_div {
    background-color: #202020;
    color: #fff;
}
div.block_div {
    background-color: #080808;
    color: #fff;
}
div.itn {
    color: #fff;
}
.katex .mord {
    color: #0bf;
}
.katex .textstyle > .mord + .mbin {
    color: #ff0;
}
.problem_input_desktop {
    background-color: #121212;
    color: #fff;
}
.button {
    background-color: #242424;
}
.info:hover, .positive:hover {
    background-color: #080;
}
}

@-moz-document domain("cymath.com") {
table tr td {
    background-color: #181818;
    color: #fff;
}
a:link.menu_link, a:visited.menu_link {
    color: #fff;
}
}
